css:
@-moz-document domain("mumuki.io") {
body {
    background: #272822 !important;
    color: #C3C3C3 !important;
}
body > div:nth-child(2) > div > div.col-md-10 > ol > li:nth-child(1) > span > a {
    color: #3498DB !important;
}
blockquote {
    background: #3E3E3E !important;
}
#wrap > div:nth-child(4) > div.col-md-6.ace-editor-col > div > ul > li.active > a {
    background: #C3C3C3 !important;
}
.ace_scroller,
.jquery-console-inner {
    background: #46483F !important;
    color: whitesmoke !important;
}
.highlight {
    background: #232323 !important;
}
.btn {
    background: #0b465d !important;
    border-color: #072B3A !important;
}
code {
    background-color: #313131 !important;
}
.err {
    background: none !important;
}
#wrap > div:nth-child(3) > div > a.text-center.muted.active {
    background-color: #616B6D;
}
span.ace_function {
    color: #3498DB !important;
}
.emoji {
    background: none !important;
}
}
